import React, { Component } from 'react';
import Newcomponent from './Newcomponent';
import MYtineraryLogo from './MYtineraryLogo';


class App extends Component {
  render() {
    return (
      <div className="App">
      <h1>MYtinerary app</h1>
      <img src={MYtineraryLogo}  alt="mainlogo" />;
      <Newcomponent />
      </div>
    );
  }
}

export default App;
